const ProductList= (props)=>{
    if(props.product.length === 0){
        return (<h2>No Product found.</h2>);
    }
    return(
        <ul className="product">
            {props.items.map((expense) => (
            <ProductItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
            />
            ))}
        </ul>
    );
   };
   
   export default ProductList;
